import React, { Component } from 'react';
import { Button } from 'antd';
import './App.css';
import 'antd/dist/antd.css'
class App extends Component {
  render() {
    return (
      <div className="App">
      <Button type="primary">Primary</Button>
      </div>
    );
  }
}

export default App;
